CREATE TABLE `cand_profile` (
  `cand_id` int NOT NULL AUTO_INCREMENT,
  `post_id` int NOT NULL,
  `cand_name` varchar(255) NOT NULL,
  `image` varchar(255) DEFAULT NULL,
  `signature` varchar(255) DEFAULT NULL,
  `cand_mob` varchar(10) NOT NULL,
  `cand_addr_corr` varchar(500) NOT NULL,
  `cand_addr` varchar(500) NOT NULL,
  `cand_email` varchar(300) NOT NULL,
  `cand_landline` varchar(15) NOT NULL,
  `cand_office` varchar(300) NOT NULL,
  `cand_pincode` varchar(10) NOT NULL,
  `cand_dob` date NOT NULL,
  `cand_cat` int NOT NULL COMMENT '1-SC 2-ST 3-OBC 4- GENERAL',
  `cand_brief_service_perticular` varchar(500) NOT NULL,
  `cand_exp_in_health_sec` varchar(255) NOT NULL,
  `last_modified_by` int DEFAULT NULL,
  `otp_no` int NOT NULL,
  `regis_otp` int NOT NULL DEFAULT '0' COMMENT '1 VARIFIED 0 - NOT VARIFIED',
  `created_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_date` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`cand_id`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=latin1;
